import React from 'react';
//import './App.css';
import { Link } from 'react-router-dom';
import store from './store';


export const MainContainer = () => {
    return (
        <ul className='FolderList'>
            {store.folders.map(folders => 
                <li key={folders.id}>
                    <Link to={`/folders/${folders.id}`}>
                        {folders.name}
                    </Link>
                </li>
            )}
        </ul>
    )
}
